#include "linkstack.h"

#define SIZE 128

char str[]="";
void FootPrint(int maze[][SIZE], MAZENODE e)
{
	int i,j;
	maze[e.x][e.y] = 2;
	for(i = 0; i < SIZE; i++){
		for(j = 0; j < SIZE; j++){
			if(maze[i][j] == 0)
				printf("#");
			else if(maze[i][j] == 2)
				printf("o");
			else
				printf(" ");
		}
		printf("\n");
	}
	printf("\n\n");	
}

MAZENODE NextPos(MAZENODE e, int di)
{
	if(di == 1 && e.y != SIZE-1) e.y++;
	if(di == 2 && e.x != SIZE-1) e.x++;
	if(di == 3 && e.y != 0) e.y--;
	if(di == 4 && e.x != 0) e.x--;
	return e;
}

int MazePath(int maze[][SIZE], MAZENODE start, MAZENODE end)
{
	LinkStack *top;
	MAZENODE e;
	MAZENODE curpos = start;
	int curstep = 0;
	do{
		if(maze[curpos.x][curpos.y] == 1){
			FootPrint(maze, curpos);
			e.seq = curstep;
			e.x = curpos.x;
			e.y = curpos.y;
			e.di = 1;
			Push(&top, e);
			if(curpos.x == end.x && curpos.y == end.y)
				return 1;
			curpos = NextPos(curpos, 1);
			curstep++;
		}
		else {
			if(!StackEmpty(top)){
				Pop(&top, &e);
				while(e.di == 4 && !StackEmpty(top)){
					maze[e.x][e.y] = -1; //shut flag
					Pop(&top, &e); //take a step back
				}
				if(e.di < 4){
					e.di++;
					Push(&top, e);
					curpos = NextPos(e, e.di);
				}
			}

		}
	}while(!StackEmpty(top));
	return 0;
}

